import React, { PureComponent } from 'react';
import {BrowserRouter as Router, Link} from "react-router-dom";

class Home extends PureComponent {
  render() {
    return (
      <header>
        <ul>
          <li>
            <Link to='/'>
              <code>/Home</code>
            </Link>
          </li>
          <li>
            <Link to='/category'>
              <code>/category</code>
            </Link>
          </li>
        </ul>
      </header>
    )
  }
}

export default Home
